import React from "react";
import {Box} from "../UI"
import {lista} from "../../info"

const List = () => {
    return <Box>
        {
            lista.cargos.map( ({id, type, value, from, date}) => {
                <div key={id}>
                    <span>{type}</span>
                    <span>{value}</span>
                </div>
            })
        }
    </Box>
}

export default List
